function DataSummary(props) {
    return (
    <>
        <h3>Here is a {props.name ? props.name : "No name"}</h3>
        <p>{props.role ? props.role : "No role"}</p>
        {props.role ? <p class="role">{props.role}</p> : <p>No role</p>}
    </>
    );
}


export default DataSummary;
